<b>LED フラッシュ ライト  犬 猫 ペット お散歩ライト 夜間 散歩 安全 補助 グッズ 選べる4色 クリックポストで発送 日時指定はできません</b><br><br>
日本郵便クリックポストで発送・日時指定はできません<br>☆郵便受けに投函となります<br><br>※代金引換の場合は宅配便代金引換で発送いたします<br><br>
☆夜間のお散歩も安心、ペットの事故防止に！明るく点滅するLED安全補助 LEDライト　<br>ポイント消化にも<br>
夜間のお散歩やウォーキング、ジョギング、ランニング、お子様のランドセルにも<br><br>
取り外し簡単！<br>
明るく点滅して暗闇でも遠くから認識できます。<br>
☆選べる４色<br>点滅の光の色は同じです<br>
・レッド（赤）<br>
・ブルー（青）<br>
・ピンク（桃）<br>
・パープル（紫）<br>
<br>
【ご使用方法】<br><br>
1.黒いプラスチックの輪っかを外してください。<br>
2.吊り金具側を持ち、ライト側を時計回りに回してください。<br>
3.ライトが点灯（点滅）します。<br>
4.消灯はライト側を時計と反対周りに回してください。<br>
※回しすぎるとライトが外れ、電池が露出します。<br>
・電池個内臓（テスト用電池）※電池交換が可能です<br>
・サイズ：（本体）6cmx2.8cmx1cm（釣り金具含む）<br>
・重さ：8ｇ（電池含む）<br>
