div id="bs1spb6"><table cellspacing="0"><tr><td id="bs1spc6"><p><font size="7">A:&nbsp;</font><font size="5">防水という保証はできませんが、内部は水が入りにく</font><br><font size="5">　　　い構造となっており、多少の雨や汗なら心配ありませ</font><br><font size="5">　　　ん。濡れた場合は乾いた布でふき取り、ふたを開けて</font><br><font size="5">　　　中に水が入っていないか確かめてください。内部に水</font><br><font size="5">　　　が入ると</font><font size="5">電子部品の故障、電池の腐食、金具の錆など</font><br><font size="5">　　　が発生する可能性があります。</font><br></table></div><div id="bs1spb7"><table cellspacing="0"><tr><td id="bs1spc7"><p><font color="#FF0099"size="7">Q：<font size="5">この商品は犬専用ですか？</font></font><br></table></div><div id="bs1spb8"><table cellspacing="0"><tr><td id="bs1spc8"><p><font size="7">A:&nbsp;</font><font size="5">金具が取り付けられるものなら何にでも使用できます。</font><br><font size="5">　　　わんちゃんのお散歩の時に飼い主さんも腰のあたりや</font><br><font size="5">　　　バッグに付けるとさらに視認性が高まり安全です。</font><br><font size="5">　　　また、ウォーキングやランニング、ジョギングの時や</font><br><font size="5">　　　ベビーカー、お子様のランドセル等にも付けておくと</font><br><font size="5">　　　夜間も安心です。</font><br></table></div></div><style type="text/css">
